	  type: "text",
	  content: ["**How do I help contribute?**  \nGlad you ask! Pull requests, or feature requests, though not always implemented, are a great way to help make Knex even better than it is now. If you're looking for something specific to help out with, there's a number of unit tests that aren't implemented yet, the library could never have too many of those. If you want to submit a fix or feature, take a look at the [Contributing](https://github.com/tgriesser/knex/blob/master/CONTRIBUTING.md) readme in the Github and go ahead and open a ticket.", "**How do I debug?**  \nKnex is beginning to make use of the [debug](https://github.com/visionmedia/debug) module internally, so you can set the `DEBUG` environment variable to `knex:*` to see all debugging, or select individual namespaces `DEBUG=knex:query,knex:tx` to constrain a bit.", "If you pass `{debug: true}` as one of the options in your initialize settings, you can see all of the query calls being made. Sometimes you need to dive a bit further into the various calls and see what all is going on behind the scenes. I'd recommend [node-inspector](https://github.com/dannycoates/node-inspector), which allows you to debug code with `debugger` statements like you would in the browser.", "At the start of your application code will catch any errors not otherwise caught in the normal promise chain handlers, which is very helpful in debugging.", "**How do I run the test suite?**  \nThe test suite looks for an environment variable called `KNEX_TEST` for the path to the database configuration. If you run the following command:"]
