	  type: "text",
	  content: ["replacing with the path to your config file, and the config file is valid, the test suite should run properly.", "**My tests are failing because slow DB connection and short test timeouts! How to extend test timeouts?**  \nSometimes, e.g. when running CI on travis, test suite's default timeout of 5 seconds might be too short. In such cases an alternative test timeout value in milliseconds can be specified using the `KNEX_TEST_TIMEOUT` environment variable."]
